import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './Dashboard.css';

const Dashboard = () => {
  const [message, setMessage] = useState('');
  const [clubs, setClubs] = useState([]);
  const [events, setEvents] = useState([]);
  const [resources, setResources] = useState([]);
  const [showClubs, setShowClub] = useState(false);
  const [showEvents, setShowEvents] = useState(false);
  const [showResources, setShowResources] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      // Fetch User-Specific Data (Clubs, Events, Resources)
      axios.get('http://localhost:8000/dashboard', {
        headers: { Authorization: `Bearer ${token}` },
      }).then((response) => {
        setMessage(response.data.message);

        // Fetch User Clubs
        axios.get('http://localhost:8000/clubs', {
          headers: { Authorization: `Bearer ${token}` },
        }).then((clubResponse) => {
          console.log("Clubs Data:", clubResponse.data.clubs);  // Debugging line
          setClubs(clubResponse.data.clubs);
        }).catch((err) => {
          console.log("Error fetching clubs:", err);
        });

        // Fetch User Events
        axios.get('http://localhost:8000/events', {
          headers: { Authorization: `Bearer ${token}` },
        }).then((eventResponse) => {
          console.log("Events Data:", eventResponse.data.events);  // Debugging line
          setEvents(eventResponse.data.events);
        }).catch((err) => {
          console.log("Error fetching events:", err);
        });

        // Fetch User Resources
        axios.get('http://localhost:8000/resources', {
          headers: { Authorization: `Bearer ${token}` },
        }).then((resourceResponse) => {
          console.log("Resources Data:", resourceResponse.data.resources);  // Debugging line
          setResources(resourceResponse.data.resources);
        }).catch((err) => {
          console.log("Error fetching resources:", err);
        });

      }).catch(() => {
        setMessage('Access denied. Please log in.');
      });
    } else {
      setMessage('Access denied. Please log in.');
    }
  }, []);

  const handleDeleteAccount = () => {
    const token = localStorage.getItem('token');
    if (token) {
      axios.delete('http://localhost:8000/delete-account', {
        headers: { Authorization: `Bearer ${token}` },
      }).then(() => {
        setMessage('Account deleted successfully. Redirecting to signup...');
        localStorage.removeItem('token');
        setTimeout(() => {
          navigate('/signup');
        }, 5000);
      }).catch(() => {
        setMessage('Error deleting account.');
      });
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  return (
    <div className="dashboard-container">
      <h1>Welcome to Your Dashboard</h1>
      <p>{message}</p>

      <div className="dashboard-actions">
        <button onClick={() => setShowClubs(!showClubs)} className="btn btn-primary">View Clubs</button>
        <button onClick={() => setShowEvents(!showEvents)} className="btn btn-primary">View Events</button>
        <button onClick={() => setShowResources(!showResources)} className="btn btn-primary">View Resources</button>
      </div>

      {/* Clubs Section */}
      {showClubs && (
        <section className="section">
          <h2>All Clubs</h2>
          <div className="card-container">
            {clubs.length > 0 ? (
              clubs.map((club) => (
                <div className="card" key={club.club_id}>
                  <h3>{club.club_name}</h3>
                  <p>{club.description}</p>
                  <p><strong>Created on:</strong> {new Date(club.creation_date).toLocaleDateString()}</p>
                </div>
              ))
            ) : (
              <p>No clubs available.</p>
            )}
          </div>
        </section>
      )}

      {/* Events Section */}
      {showEvents && (
        <section className="section">
          <h2>Upcoming Events</h2>
          <div className="card-container">
            {events.length > 0 ? (
              events.map((event) => (
                <div className="card" key={event.event_id}>
                  <h3>{event.event_name}</h3>
                  <p>{event.event_description}</p>
                  <p><strong>Date:</strong> {new Date(event.event_date).toLocaleString()}</p>
                  <p><strong>Location:</strong> {event.location}</p>
                </div>
              ))
            ) : (
              <p>No events available.</p>
            )}
          </div>
        </section>
      )}

      {/* Resources Section */}
      {showResources && (
        <section className="section">
          <h2>Available Resources</h2>
          <div className="card-container">
            {resources.length > 0 ? (
              resources.map((resource) => (
                <div className="card" key={resource.resource_id}>
                  <h3>{resource.title}</h3>
                  <p><strong>Type:</strong> {resource.type}</p>
                  <p><strong>Uploaded on:</strong> {new Date(resource.upload_date).toLocaleString()}</p>
                </div>
              ))
            ) : (
              <p>No resources available.</p>
            )}
          </div>
        </section>
      )}

      {/* Actions */}
      <div className="dashboard-actions">
        <button onClick={handleDeleteAccount} className="btn btn-danger">Delete Account</button>
        <button onClick={handleLogout} className="btn btn-secondary">Logout</button>
      </div>
    </div>
  );
};

export default Dashboard;
